import React from 'react';
import ImageUploader from 'react-images-upload';

const ChartUpload = (props)=>{
    return(
            <ImageUploader
                withIcon={true}
                buttonText='Choose images'
                imgExtension={['.jpg', '.gif', '.png', '.gif']}
                maxFileSize={5242880}
            />
        
    )
};

export default ChartUpload;
